import React from "react";
import Header from "./Header";
import Home from "./Home";
import Ad from "./Ad";
import History from "./History";
import Footer from "./Footer";

function App() {
  return (
    <div>
      <Header />
      <Home />
      <Ad />
      <History />
      <Footer />
    </div>
  );
}

export default App;
